// TaskList.jsx
import React from "react";
import TaskItem from "./TaskItem";
import "./TaskList.css";

const TaskList = ({ list }) => {
  return (
    <div className="task-list">
      <div className="list-title">{list.title}</div>
      <div className="task-items">
        {list.map((task) => (
          <TaskItem key={task.id} task={task} />
        ))}
      </div>
    </div>
  );
};

export default TaskList;
